&quot;Nirmala UI&quot;,sans-serif">এছাড়া
তিনি বিভিন্ন মিডিয়ায় শিশুস্বাস্থ্য বিষয়ে নিয়মিত অনুষ্ঠান করে ছাত্রজীবন থেকেই বিভিন্ন
সামাজিক, রাজনৈতিক ও জাতীয় জীবনে গুরুত্বপূর্ণ বিষয়ে অসামান্য অবদান রেখেছেন। বাংলাদেশের
আপামর চিকিৎসক সমাজের অধিকার প্রতিষ্ঠায় অগ্রপথিক অধ্যাপক ভূইয়া বাংলাদেশ প্রাইভেট
মেডিক্যাল প্রাকটিশনার্স এসোসিয়েশনের মহাসচিব ও শিশু চিকিৎসক সংস্থার ট্রেজারার হিসেবে
সাফল্যের সাথে দায়িত্ব পালন করেছেন। মুক্তিযুদ্ধের চেতনায় প্রতিষ্ঠিত স্বাধীনতা চিকিৎসক
পরিষদের কেন্দ্রীয়ভাবে নেতৃত্ব দিচ্ছেন। তিনি ২০০০ সালে প্রতিষ্ঠা করেছেন প্রাইভেট
মেডিক্যাল কলেজগুলোর মধ্যে অন্যতম হলি ফ্যামিলি রেড ক্রিসেন্ট মেডিক্যাল কলেজ। মুন্সীগঞ্জ
ও পুরনো ঢাকায় ফ্রি ফ্রাইডে ক্লিনিকের মাধ্যমে তিনি দুঃস্থ শিশুদের নিয়মিত চিকিৎসা
প্রদান করে যাচ্ছেন। বর্তমানে তিনি বিভিন্ন চিকিৎসা ও সেবামূলক সংস্থার সাথে কাজ করছেন-
বাংলাদেশ মেডিক্যাল এসোসিয়েশন (বিএমএ)’র কেন্দ্রীয় কমিটির সিনিয়র নির্বাহী সদস্য, প্রাইভেট
ক্লিনিক ও ডায়াগনস্টিক ওনার্স এসোসিয়েশনের সম্মানীত সভাপতি এবং ঢাকা মেডিক্যাল কলেজ
এলামাইন এসোসিয়েশনের সম্মানীত সহ-সভাপতি পদে অধিষ্ঠিত অধ্যাপক ভূইয়া। এছাড়া চেয়ারম্যান
হিসেবে মুভমেন্ট ফর এনভায়রনমেন্টাল ডেভেলপমেন্ট এন্ড সোসাল সার্ভিস অব বাংলাদেশ (এমইডিএএস)’র
মাধ্যমে দুর্গতদের মাঝে ত্রাণ, প্রাথমিক শিক্ষা ও স্যানিটেশন প্রোগ্রামের মাধ্যমে সেবা
প্রদান করেছেন। আন্তর্জাতিক খ্যাতিসম্পন্ন&nbsp;
বাংলাদেশ রেড ক্রিসেন্ট সোসাইটি, ন্যাশনাল হার্ট ফাউন্ডেশন, বাংলাদেশ ক্যান্সার
সোসাইটি, বাংলাদেশ মেডিক্যাল এসোসিয়েশন, প্রেসিডেন্ট, বাংলাদেশ প্রাইভেট মেডিক্যাল
প্রাকটিশনার এসোসিয়েশন, মেম্বার, বিএমএ, বিপিএমপিএ ও আমেরিকান এলামনাই এসোসিয়েশন সংস্থার
